// And groups predicates with the AND operator between them.
func And(predicates ...predicate.Microservice) predicate.Microservice {
	return predicate.Microservice(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.Microservice) predicate.Microservice {
	return predicate.Microservice(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.Microservice) predicate.Microservice {
	return predicate.Microservice(sql.NotPredicates(p))
}
